import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import '../styles/App.css';
import Home from '../pages/Home';

function App() {
  return (
<Router> 
  <Switch>
    <Route path='/' exact strict component={Home} />
  </Switch>
</Router>
  );
}

export default App;
